import ContactPage from './contact'
import List from './list'
import cookie from 'react-cookies'
import 'whatwg-fetch'
import React, { Component,useState,useEffect } from 'react';
import ReactDOM from 'react-dom';
import PostInline from './compenents/post'
import Contact from './compenents/contact'
import Navbar from './compenents/Navbar'
import Detail from './product detail'
import {BrowserRouter,Route,Redirect,Switch} from 'react-router-dom'
import notfound from './404'
import CreateProduct from './compenents/createproduct';
import Login from './login'
import Register from './register';
import Announce_post from './compenents/announce_part';
import Announcements from './announcements';
import UpdateProduct from './updateproduct';
import Wishlist from './wishlist';
import axios from 'axios'
import Cart from './cart'
import Profile from './profile';
import ProfileForm from './compenents/profile_form';
import App from './compenents/map';

class Home extends Component {
    state={
        cart:0,
        wishlist:0
    }
    componentDidMount(){
        axios.get('/sdlkewrws/')
        .then(response => {
        this.setState({
            cart:response.data.cart,
            wishlist:response.data.wishlist
        })
        })
    }
    render() { 
        return (
                <BrowserRouter>
                <Switch>
                    <Route exact path = "/"> <div> <Navbar state={this.state}/><br/>
 <div className='container'><h2>This is home page</h2></div> </div>  </Route>
                    <Route path = "/product_list" component={List} />
                    <Route path = "/contact" component={Contact} />
                    <Route path = "/product/detail/:slug" component={Detail} />
                    <Route path = "/notfound" component={notfound} />
                    <Route path = '/create/product' component={CreateProduct} />
                    <Route path = '/login' component={Login} />
                    <Route path = '/signup' component={Register} />
                    <Route path = '/announcement' component={Announcements} />
                    <Route path = '/update/:id' component={UpdateProduct} />
                    <Route path = '/wishlist/' component={Wishlist} />
                    <Route path = '/cart/' component={Cart} />
                    <Route path = '/profile' component={Profile} />
                    <Route path = '/edit/' component={ProfileForm} />
                    <Route path = '/map/' component={App} />
                </Switch>

      </BrowserRouter>
        );
    }
}
 
export default Home;
